<p>MongoDB通过使用<code>$near</code>，<code>$within</code>，<code>geoWithin</code>和<code>$nearSphere</code>等运算符支持地理空间查询。<code>Criteria</code>类提供了特定于地理空间查询的方法。还有一些形状类（<code>Box</code>，<code>Circle</code>和<code>Point</code>）与地理空间相关的<code>Criteria</code>方法结合使用</p>
